const tasks = [
    {
        id: 1,
        text: 'Work at CSIT',
        day: 'Feb 5th at 2:30pm',
        reminder: false,
    }
]

const Task = () => {
    return (
        <>
            {
                tasks.map((task) => (<h3>{task.text}</h3>))
            }
        </>
    )
}

export default Task
